# convert_sequence.py

import re
from pathlib import Path

# Define all joint settings
default_pwm = [
    328, 320, 400, 480, 309, 180, 468, 349, 290, 200, 445, 320, 303,
    312, 207, 260, 417, 470, 312, 320, 290, 170, 206, 420, 280
]
default_deg = [
    0, 0, 0, 0, 0, -90, -90, -90, 90, 0, 90, 0, 0,
    0, 0, 0, 0, 90, 90, 0, 0, 90, 90, 0, 0
]
step_pwm = [
    120, 120, 120, 120, 120, 85, 75, 120, 85, 85, 85, 120, 120,
    120, 120, 120, 120, 85, 120, 120, 120, 85, 85, 85, 85
]
step_deg = [
    45, -45, 45, 45, 45, 45, -45, -45, 45, 45, 45, -45, 45, -45, 45,
    -45, 45, 45, -45, 45, 45, -45, -45, -45, 45
]

joint_names = [
    "/l_ankle_x", "/l_knee_x", "/l_hip_x", "/l_hip_y", "/l_hip_z",
    "/l_elbow_y", "/l_shoulder_y", "/l_arm_x", "/l_wrist_x", "/l_gear_z",
    "/l_shoulder_x", "/chest_z", "/r_ankle_x", "/r_knee_x", "/r_hip_y",
    "/r_hip_x", "/r_hip_z", "/r_elbow_y", "/r_arm_x", "/head_y", "/head_x",
    "/r_shoulder_x", "/r_shoulder_y", "/r_gear_z", "/r_wrist_x"
]
used_joints = [
    "/l_hip_x","/r_hip_x","/l_knee_x","/r_knee_x",
    "/l_ankle_x","/r_ankle_x","/l_hip_z","/r_hip_z","/chest_z"
]
used_indices = [joint_names.index(joint) for joint in used_joints]

def deg_to_pwm(deg, index):
    #return deg
    return int(round(default_pwm[index] + ((deg - default_deg[index]) / step_deg[index]) * step_pwm[index]))

def convert_deg_string_to_pwm_file(deg_string: str, output_path="converted_sequence.txt"):
    raw_rows = re.findall(r"\{([^\{\}]+)\}", deg_string)
    output_lines = []
    header = "#time " + " ".join([f"{i:<4}" for i in range(25)])
    output_lines.append(header)

    for i, raw in enumerate(raw_rows):
        values = list(map(float, raw.strip().split(",")))
        row_pwm = default_pwm.copy()
        for j, idx in enumerate(used_indices):
            if j < len(values):
                row_pwm[idx] = deg_to_pwm(values[j], idx)
        line = f"{i * 500:<6}" + " ".join(str(pwm).ljust(4) for pwm in row_pwm)
        output_lines.append(line)

    try:
        with Path(output_path).open("w") as f:
            f.write("\n".join(output_lines))
        print(f"File saved successfully to {output_path}")
    except Exception as e:
        print("Error saving to file:", e)


